import React from "react";

const ExpenseItem = ({ expenses }) => {
  return (
    <div className="ExpenseItem">
      {expenses.map((item) => (
        <div key={item.id}>
          {item.name}
          {item.price}
          {item.type}
          {item.date}
        </div>
      ))}
    </div>
  );
};

export default ExpenseItem;
